import React from 'react';
import { Carousel,Image } from 'antd';

const contentStyle = {
    weight: '800px',
    height: '800px',
};



export default class St extends React.Component {
    state = {
        key: 0,
    };

    onChange = a => {
        this.setState({
            key: a,
        })
    }
    render() {
        return(
            <div className='pic_container'>
                
                {/* <img src={'./img/result'+this.state.key+'.jpg'}  className='p1'/> */}
                <Image className='p1' src="error" fallback="data:image/png;base64,"
                />
                <div className='select'>
                    <Carousel afterChange={this.onChange} autoplay>
                        <div>
                            <img src='' style={contentStyle} />
                        </div>
                        <div>
                            <img src='' style={contentStyle} />
                        </div>
                        <div>
                            <img src='' style={contentStyle} />  
                        </div>
                    </Carousel>
                    <h1 className='cn'> 请选择你喜欢的风格!</h1>
                </div>
                
            </div>
        )
    }
}
